import React from 'react';
import logo from './logo.svg';
import './App.css';
import Footer from './Components/Footer'


function App() {
  return (
    <div className="App">
      <header className="App-header">

        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <div>
          Learn Reactt
        </div>
        <Footer />
      </header>
    </div>
  );
}

export default App;
